// 	}

  const handleAddBill = () => {
	console.log('Add Bil');
	window.location.href = '/add_cukai_taksiran';
}

  const handleBayar = () => {
	  console.log('Bayar');
	  window.location.href = '/payment';
  }


  return (
	<div>
      <Sidebar />
		<div className="relative md:ml-64 bg-gray-400" style={{ height: "100vh" }}>
			<Navbar />
			<Pane background="#2c3e50" className="p-3">
			
			<Heading size={400} color="white"><Icon icon={ArrowLeftIcon} size={12} /> / Senarai Cukai</Heading>
			</Pane>
			{/* Header */}
						<div className="relative bg-gray-500 md:pt-32 pt-4 pb-4" style={{height: "100%"}}>
							<div className="px-4 md:px-10 mx-auto w-full" >
								<div className="flex flex-wrap">
									<div className="w-full px-4">
										<div className="relative flex flex-col min-w-0 break-words">
											<div className="flex-auto p-4">
												<div className="flex flex-row ">
													<div className="relative w-full pr-4 max-w-full flex-grow flex-1">
														<Pane background="#2c3e50" className="p-3 rounded-md">
															<Heading size={400} color="white">Bil Cukai Taksiran</Heading>
														</Pane>
													</div>
													<div  className="relative w-auto pl-4 flex-initial" onClick={handleAddBill} >
														<Button
														appearance="primary"
														intent="success"
														iconBefore={AddIcon}
														>
															Tambah
														</Button>
													</div>
												</div>
											</div>
										</div>
									</div>

									<div className="w-full p-2">
										<div className="absolute flex flex-col min-w-0 break-words">
											<div className="flex-auto">
												<BillList />
											</div>
										</div>
									</div>

								</div>
							</div>
							{
								// List state -> so class
								// View bill state -> class jugak
								// routing sikit
							}
							{/* <BillList /> */}
					</div>
					{/* <Footer /> */}
			</div>
        
      </div>
  );
}

export default Bill;
